import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import {RouterModule, Routes} from "@angular/router";
import { UploadComponent } from './upload/upload.component';

const routes: Routes = [
  {
    path: '',
    component: UploadComponent
  }
];

@NgModule({
  declarations: [
    UploadComponent
  ],
  imports: [
    RouterModule.forChild(routes),
    CommonModule
  ],
  exports: [RouterModule]
})
export class ActivationModule { }

import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HistoryComponent } from './components/pages/history/history.component';
import {DefaultModule} from "./modules/default/default.module";
import {ActivationModule} from "./modules/activation/activation.module";
import {AuthModule} from "./modules/auth/auth.module";
import {DashboardModule} from "./modules/dashboard/dashboard.module";
import {SettingsModule} from "./modules/settings/settings.module";
import {SharedModule} from "./modules/shared/shared.module";
import {ReactiveFormsModule} from "@angular/forms";

@NgModule({
  declarations: [
    AppComponent,
    HistoryComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ActivationModule,
    AuthModule,
    DashboardModule,
    DefaultModule,
    SettingsModule,
    SharedModule
  ],
  providers: [],
  exports: [
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }

import {NgModule} from '@angular/core';
import {RouterModule, Routes} from '@angular/router';
import {LayoutComponent} from "./modules/default/layout/layout.component";
import {HistoryComponent} from "./components/pages/history/history.component";

const routes: Routes = [
  {
    path: 'auth',
    loadChildren: () => "import('./modules/auth/auth.module').then(mod => mod.AuthModule)"
  },
  {
    path: '',
    component: LayoutComponent,
    children: [
      {
        path: '',
        redirectTo: 'home',
        pathMatch: 'full'
      },
      {
        path: 'home',
        loadChildren: () => "import('./modules/dashboard/dashboard.module').then(mod => mod.DashboardModule)",
        data: {preload: true}
      },
      {
        path: 'historique',
        component: HistoryComponent
      },
      {
        path: 'activation',
        loadChildren: () => "import('./modules/activation/activation.module').then(mod => mod.ActivationModule)",
        data: {preload: true}
      },
      {
        path: 'settings',
        loadChildren: () => "import('./modules/settings/settings.module').then(mod => mod.SettingsModule)",
        data: {preload: true}
      }
    ]
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule {
}

